import Nav from "../Nav";
import Helmet from "react-helmet";
import React from "react";
import Canvas from "./Canvas";
class Rectangle {
  constructor(x, y) {
    this.x = x;
    this.y = y;
  }
}
var cur_rects = createRects();
export default function Portfolio() {
  const draw = (ctx, frameCount) => {
    ctx.clearRect(0, 0, ctx.canvas.width, ctx.canvas.height);

    drawRects(ctx, cur_rects);
  };
  return (
    <div>
      <Nav />
      <Canvas draw={draw} />
    </div>
  );
}

function createRects() {
  var rects = [];
  for (var row = 0; row < 10; row++) {
    var rects_add = [];
    for (var spot = 0; spot < 10; spot++) {
      rects_add.concat(new Rectangle(spot * 10, row));
      console.log(spot * 10, row);
    }
    rects.concat(rects_add);
  }
  return rects;
}
function drawRects(ctx, cur_rects) {
  for (i in cur_rects) {
    for (j in i) {
      ctx.fillStyle = "white";
      ctx.beginPath();
      ctx.rect(i.x, i.y, 10, 10);
      ctx.fill();
    }
  }
}
